import sys
import math
from collections import deque

def main():
    data = sys.stdin.read().strip().split()
    if not data:
        return
    it = iter(data)
    n = int(next(it)); m = int(next(it))
    adj = [[] for _ in range(n)]
    edges = []
    for _ in range(m):
        u = int(next(it)) - 1
        v = int(next(it)) - 1
        g = int(next(it)); l = int(next(it))
        edges.append((u,v,g,l))
        adj[u].append((v,g,l))
        adj[v].append((u,g,l))
    val = [0]*n
    for i in range(n):
        if val[i]!=0: continue
        if not adj[i]:
            val[i]=1
            continue
        # try to determine using BFS, starting assign 1 initial candidate multiples
        # We'll attempt to assign by exploring factors of first edge L that are consistent.
        # Pick first neighbor to generate candidates for i
        u = i
        v,g0,l0 = adj[u][0]
        # possible gu such that gu divides l0, gu % g0 ==0? Actually gcd(a,b)=g0 => a = g0 * A, b = g0 * B with gcd(A,B)=1 and l0 = g0*A*B
        if l0 % g0 != 0:
            print("NO"); return
        prod = l0 // g0  # = A*B
        # enumerate divisors A of prod where gcd(A, prod//A)==1
        candA = []
        d = 1
        while d*d <= prod:
            if prod % d == 0:
                A = d
                B = prod//d
                if math.gcd(A,B)==1:
                    candA.append(g0*A)
                if A!=B:
                    A2 = B; B2 = d
                    if math.gcd(A2,B2)==1:
                        candA.append(g0*A2)
            d+=1
        success=False
        for start in candA:
            assign = [0]*n
            q=deque()
            assign[u]=start
            q.append(u)
            ok=True
            while q and ok:
                x=q.popleft()
                for y,g,l in adj[x]:
                    ax = assign[x]
                    if ax % g !=0:
                        ok=False; break
                    if (l % ax)!=0:
                        ok=False; break
                    # by properties, ay = l* g / ax? Actually l = lcm(ax,ay). We know ax*gcd(ax,ay)=g*lcm? Better compute ay = l * g / ax
                    # From representation: ax = g * A, ay = g * B, l = g*A*B => ay = l//ax
                    ay = l // ax
                    if ay * ax != l:
                        ok=False; break
                    if math.gcd(ax,ay) != g:
                        ok=False; break
                    if assign[y]==0:
                        assign[y]=ay
                        q.append(y)
                    else:
                        if assign[y]!=ay:
                            ok=False; break
            if ok:
                # commit assign
                for idx in range(n):
                    if assign[idx]!=0:
                        val[idx]=assign[idx]
                success=True
                break
        if not success:
            print("NO"); return
    # final verification across all edges
    for u,v,g,l in edges:
        if math.gcd(val[u],val[v])!=g or (val[u]*val[v]//math.gcd(val[u],val[v])!=l):
            print("NO"); return
    print("YES")
    print(" ".join(str(x if x!=0 else 1) for x in val))

if __name__ == "__main__":
    main()
